The Daaquam River (French: Rivière Daaquam) is a river primarily flowing in the administrative region of Chaudière-Appalaches, at South of Quebec in Canada and northern Maine, in United States. The river runs from its source (46°22′01″N 70°22′48″W﻿ / ﻿46.367°N 70.38°W), south of Sainte-Justine, northeast across the Canada–United States border to the Northwest Branch of the Saint John River in Maine. Its current is flowing through: 
*  Les Etchemins Regional County Municipality (RCM): municipalities Lac-Etchemin, Quebec, Sainte-Justine, Quebec and Saint-Camille-de-Lellis, Quebec (forming the boundary of the townships of Daaquam and Bellechasse); 
*  Montmagny Regional County Municipality (RCM): municipality Saint-Just-de-Bretenières, Quebec (Panet Township); 
*  Aroostook County (Township T11 R17 WELS), in the state of Maine, the United States. On the Canadian side, the Canadian Pacific Railway and Route 204 runs along the North side of the Daaquam river. The Daaquam river flows mostly in forest areas, crossing some agricultural areas. This river flows into the North East by gradually approaching the Canada-US border that it cross the boundary in the Township of Panet (in Quebec) and T11 R17 WELS Township (in Maine).
